INSERT INTO `v1_103c930a7756a177b04abc5eb3e59734a86f01241e4ce78dfa5b1abe4eb898f3` VALUES (110, 160, 1, "仲間と夏を楽しむ、夏海の魔法士。自分を変えたいという固い決意で、障害物を無効化して走り続ける。", 122601, 1, 0, 0, 1.5, 105, 1, 101, 1, 0.029);
INSERT INTO `v1_103c930a7756a177b04abc5eb3e59734a86f01241e4ce78dfa5b1abe4eb898f3` VALUES (105, 120, 2, "太陽よりも輝く、夏海の元気娘。　持ち前の身体能力で、どんなコースも柔軟に対応し、駆け抜ける。", 122401, 0, 1, 0, 2.5, 111, 2, 102, 3, 0.014);
INSERT INTO `v1_103c930a7756a177b04abc5eb3e59734a86f01241e4ce78dfa5b1abe4eb898f3` VALUES (110, 350, 3, "波打ち際に煌めく、夏海の剣士。　日々の鍛錬で鍛えた脚で、長い距離も速度を落とさず走り切る。", 122501, 0, 0, 1, 2.5, 105, 3, 103, 2, 0.017);
INSERT INTO `v1_103c930a7756a177b04abc5eb3e59734a86f01241e4ce78dfa5b1abe4eb898f3` VALUES (110, 130, 4, "海の幸に目がない、渚のお姫様。　『王家の装備』の力を解放し、障害物をものともせず前へと進む。", 107501, 0, 1, 0, 1.5, 105, 4, 104, 3, 0.016);
INSERT INTO `v1_103c930a7756a177b04abc5eb3e59734a86f01241e4ce78dfa5b1abe4eb898f3` VALUES (110, 160, 5, "海でも主さまをお世話する、白浜の巫女。精霊の力で自身を加速させ、誰よりも速くゴールを目指す。", 107601, 1, 0, 0, 2.5, 105, 5, 105, 1, 0.014);
INSERT INTO `v1_103c930a7756a177b04abc5eb3e59734a86f01241e4ce78dfa5b1abe4eb898f3` VALUES (120, 255, 6, "水着姿を恥じらう、ツンデレ猫娘。お得意の魔法で、対戦相手の走りを妨害し、レースを有利に進める。", 107801, 0, 0, 1, 3.5, 103, 6, 106, 2, 0.029);
INSERT INTO `v1_103c930a7756a177b04abc5eb3e59734a86f01241e4ce78dfa5b1abe4eb898f3` VALUES (120, 160, 7, "優雅に浜を駆ける、真夏のマホ姫。しゃなりしゃなりと、雅な身のこなしで障害物を跳び越えていく。", 110601, 1, 0, 0, 3.5, 103, 7, 107, 1, 0.013);
INSERT INTO `v1_103c930a7756a177b04abc5eb3e59734a86f01241e4ce78dfa5b1abe4eb898f3` VALUES (110, 350, 8, "浜の平和を守る、真夏の狼娘。　　獣人の強靭なスタミナで、レース　後半にスパートをかける。", 110401, 0, 0, 1, 2.5, 103, 8, 108, 2, 0.014);
INSERT INTO `v1_103c930a7756a177b04abc5eb3e59734a86f01241e4ce78dfa5b1abe4eb898f3` VALUES (105, 130, 9, "浜に力強く舞う、真夏の南国娘。　レースの喧噪の中でも精神を乱さず後半に大きな捲りを見せる。", 110501, 0, 1, 0, 1.5, 100, 9, 109, 3, 0.012);
INSERT INTO `v1_103c930a7756a177b04abc5eb3e59734a86f01241e4ce78dfa5b1abe4eb898f3` VALUES (105, 200, 10, "浜の事件を嗅ぎ付けた、真夏の　　名探偵。高い推理力と魔法で、的確に対戦相手の走りを乱す。", 115701, 1, 0, 0, 2.5, 103, 10, 110, 1, 0.014);
INSERT INTO `v1_103c930a7756a177b04abc5eb3e59734a86f01241e4ce78dfa5b1abe4eb898f3` VALUES (105, 350, 11, "再び鎧を脱いだ、灼熱の騎士団長。実戦で培った判断力で、瞬時にバリアを展開し、障害物を無力化する。", 113601, 0, 0, 1, 2.5, 103, 11, 111, 2, 0.071);
INSERT INTO `v1_103c930a7756a177b04abc5eb3e59734a86f01241e4ce78dfa5b1abe4eb898f3` VALUES (120, 130, 12, "水が苦手な、海辺の気まぐれ猫娘。浜に現れた美少女義賊は、対戦相手のスピードを奪いとる。", 107901, 0, 1, 0, 1.5, 103, 12, 112, 3, 0.014);
INSERT INTO `v1_103c930a7756a177b04abc5eb3e59734a86f01241e4ce78dfa5b1abe4eb898f3` VALUES (110, 200, 13, "バカンスも効率第一な、海の傭兵。レースでも最高効率を求め、どんな状況でも隙のない走りを見せる。", 108001, 1, 0, 0, 1.5, 105, 13, 113, 2, 0.022);
INSERT INTO `v1_103c930a7756a177b04abc5eb3e59734a86f01241e4ce78dfa5b1abe4eb898f3` VALUES (110, 160, 14, "真夏の太陽が良く似合う、海辺の　サレンママ。多才で器用、どんな　障害物もエレガントに越えていく。", 110301, 1, 0, 0, 2.5, 108, 14, 114, 1, 0.031);
INSERT INTO `v1_103c930a7756a177b04abc5eb3e59734a86f01241e4ce78dfa5b1abe4eb898f3` VALUES (110, 130, 15, "海に嵐を呼ぶ夏のドジっ娘メイド。日頃から災難に慣れており、多少　のトラブルには動じたりしない。", 107701, 0, 1, 0, 0.5, 105, 15, 115, 1, 0.036);
INSERT INTO `v1_103c930a7756a177b04abc5eb3e59734a86f01241e4ce78dfa5b1abe4eb898f3` VALUES (110, 350, 16, "粋な夏を愉しむ、若夏の姉御。　　流麗な身体捌きで、始・継・終と、UBを重ねるごとに、加速する。", 113101, 0, 0, 1, 3.5, 95, 16, 116, 2, 0.048);
INSERT INTO `v1_103c930a7756a177b04abc5eb3e59734a86f01241e4ce78dfa5b1abe4eb898f3` VALUES (105, 130, 17, "夏のトキメキに触れた、オタク魔法少女。多彩な魔法を操り、少しずつ他の走者の速度を落とし続ける。", 113301, 0, 1, 0, 1.5, 105, 17, 117, 3, 0.043);
INSERT INTO `v1_103c930a7756a177b04abc5eb3e59734a86f01241e4ce78dfa5b1abe4eb898f3` VALUES (105, 130, 18, "海獄に降臨せし、真夏の冥姫。　　レース後半に魔力を全解放し、　　蒼き疾風と成りて浜を駆け抜ける。", 113201, 0, 1, 0, 1.5, 95, 18, 118, 2, 0.018);
INSERT INTO `v1_103c930a7756a177b04abc5eb3e59734a86f01241e4ce78dfa5b1abe4eb898f3` VALUES (110, 160, 19, "夏の夕を火花で彩る、渚の壊し屋。『壊し屋』の異名と過激な愛情は、対戦相手にプレッシャーを与える。", 117001, 1, 0, 0, 2.5, 108, 19, 119, 2, 0.021);
INSERT INTO `v1_103c930a7756a177b04abc5eb3e59734a86f01241e4ce78dfa5b1abe4eb898f3` VALUES (110, 255, 20, "青春に生きる者を導く、夏の先生。夢へと邁進する聖母の加護が、その身をあらゆる困難から守る。", 113501, 0, 0, 1, 2.5, 105, 20, 120, 1, 0.036);
INSERT INTO `v1_103c930a7756a177b04abc5eb3e59734a86f01241e4ce78dfa5b1abe4eb898f3` VALUES (105, 350, 21, "笑顔の応援が眩しい、夏の超能力　ガール。超能力を駆使して、どんな障害物もひとっ飛びで乗り越える。", 113401, 0, 0, 1, 2.5, 105, 21, 121, 3, 0.02);
INSERT INTO `v1_103c930a7756a177b04abc5eb3e59734a86f01241e4ce78dfa5b1abe4eb898f3` VALUES (110, 130, 22, "海辺で大人の魅力を放つ、夏の　　セクシー先生。その魅力に囚われた対戦相手は、走りを乱してしまう。", 110101, 0, 1, 0, 2.5, 105, 22, 122, 1, 0.018);
INSERT INTO `v1_103c930a7756a177b04abc5eb3e59734a86f01241e4ce78dfa5b1abe4eb898f3` VALUES (105, 160, 23, "水着も絶対外さない、夏のカリスマモデル。走りのバイブスは超テンアゲで、スピードはおにやば。", 110001, 1, 0, 0, 3.5, 111, 23, 123, 3, 0.03);
INSERT INTO `v1_103c930a7756a177b04abc5eb3e59734a86f01241e4ce78dfa5b1abe4eb898f3` VALUES (110, 130, 24, "南の島も盛り上げる、真夏のアイドル。悪天候でも笑顔を絶やさず後半もリズムを上げて走り切る。", 117201, 0, 1, 0, 1.5, 103, 24, 124, 1, 0.027);
INSERT INTO `v1_103c930a7756a177b04abc5eb3e59734a86f01241e4ce78dfa5b1abe4eb898f3` VALUES (105, 160, 25, "海原に美声を響かす、渚の歌姫。　守護の賛歌と精霊の加護により、　障害物から身を守る。", 117301, 1, 0, 0, 3.5, 108, 25, 125, 2, 0.02);
INSERT INTO `v1_103c930a7756a177b04abc5eb3e59734a86f01241e4ce78dfa5b1abe4eb898f3` VALUES (110, 350, 26, "夏でも天邪鬼な、夕凪のテーラー。張り巡らされた魔法の糸で、他の走者の自由を奪う。", 117401, 0, 0, 1, 2.5, 105, 26, 126, 3, 0.04);
INSERT INTO `v1_103c930a7756a177b04abc5eb3e59734a86f01241e4ce78dfa5b1abe4eb898f3` VALUES (110, 350, 27, "向日葵が良く似合う、海辺の　　　お姉ちゃん。秘密結社の一員で、　抜群の身体能力が一番の武器。", 117101, 0, 0, 1, 3.5, 105, 27, 127, 1, 0.009);
INSERT INTO `v1_103c930a7756a177b04abc5eb3e59734a86f01241e4ce78dfa5b1abe4eb898f3` VALUES (120, 255, 28, "渚でおっとり、夏色うさぎっこ。　うさぎさんパワー全開で、ぴょん　ぴょんとコースを跳ね回る。", 122901, 0, 0, 1, 3.5, 105, 28, 128, 1, 0.022);
INSERT INTO `v1_103c930a7756a177b04abc5eb3e59734a86f01241e4ce78dfa5b1abe4eb898f3` VALUES (110, 130, 29, "無邪気さ弾ける、夏色いたずら娘。砂浜でも、いたずらの準備は万端！レースに大波乱が巻き起こる！？", 122801, 0, 1, 0, 2.5, 105, 29, 129, 3, 0.028);
INSERT INTO `v1_103c930a7756a177b04abc5eb3e59734a86f01241e4ce78dfa5b1abe4eb898f3` VALUES (105, 130, 30, "海でも真面目な、夏色優等生。　　高めた魔力を解き放ち、一瞬の内に他の走者を置き去りにする。", 122701, 1, 0, 0, 3.5, 108, 30, 130, 2, 0.023);
